import React, { useState, useEffect } from 'react';

const App = () => {
  const [form2Content, setForm2Content] = useState('');

  useEffect(() => {
    // Cargar el contenido de form2.html al montar el componente
    fetch('./components/form2.html')
      .then(response => response.text())
      .then(data => setForm2Content(data));
  }, []); // El array vacío asegura que esto se ejecute solo una vez, equivalente a componentDidMount en clases

  return (
    <div>
      <CorreoForm />
      <h1>Formulario de Correo</h1>
      <div dangerouslySetInnerHTML={{ __html: form2Content }} />
    </div>
  );
};

export default App;
